import "./Gallery.css";

export default function Gallery() {
  return (
    <section className="gallery" id="gallery">
      <h2>Our Work</h2>
      <div className="gallery-grid">
        <img src="/images/nail1.jpg" alt="Nail art 1" />
        <img src="/images/nail2.jpg" alt="Nail art 2" />
        <img src="/images/nail3.jpg" alt="Nail art 3" />
        <img src="/images/nail4.jpg" alt="Nail art 5" />
        <img src="/images/nail5.jpg" alt="Nail art 2" />
        <img src="/images/nail6.jpg" alt="Nail art 3" />
      </div>
    </section>
  );
}
